import React, { useEffect } from "react";
import axios from "axios";
// import { Container } from './styles';

function Playlist() {
  useEffect(() => {
    axios
      .get(
        `https://accounts.spotify.com/authorize?client_id=a2e8c60cfb3d408bbf7be2f6ec02a044&redirect_uri=http://localhost:3000&response_type=token&state=123`
      )
      .then((response) => {
        console.log("aqui", response.data);
      });
  }, []);

  useEffect(() => {
    axios
      .get("https://api.spotify.com/v1/me", {
        headers: {
          Authorization:
            "Bearer " +
            "BQB1HyKh6GwEsaLnCJIrxqKnCbUDU6CPQHsvlWfMwv_tUjr71Yyh-dfN8E3Ns0MTDd3yBfEJMW2KRwipfmntlTmW6bVGSA48PrC5a51Cvq6PTYM0EHLrnefWJFCTiQUplmw6r8-HMfFs1mOdjpKkJqcDx9MYvBKrj_0",
        },
      })
      .then((response) => console.log("aqui", response));
  }, []);

  useEffect(() => {
    axios
      .get(
        "https://api.spotify.com/v1/browse/featured-playlists?country=SE&limit=2",
        {
          headers: {
            Authorization:
              "Bearer " +
              "BQB1HyKh6GwEsaLnCJIrxqKnCbUDU6CPQHsvlWfMwv_tUjr71Yyh-dfN8E3Ns0MTDd3yBfEJMW2KRwipfmntlTmW6bVGSA48PrC5a51Cvq6PTYM0EHLrnefWJFCTiQUplmw6r8-HMfFs1mOdjpKkJqcDx9MYvBKrj_0",
          },
        }
      )
      .then((response) => console.log("depois", response));
  }, []);

  useEffect(() => {
    axios
      .get(
        "https://api.spotify.com/v1/browse/featured-playlists?country=SE&timestamp=2020-06-25T11%3A54%3A32&offset=0&limit=2",
        {
          headers: {
            Authorization:
              "Bearer " +
              "BQB1HyKh6GwEsaLnCJIrxqKnCbUDU6CPQHsvlWfMwv_tUjr71Yyh-dfN8E3Ns0MTDd3yBfEJMW2KRwipfmntlTmW6bVGSA48PrC5a51Cvq6PTYM0EHLrnefWJFCTiQUplmw6r8-HMfFs1mOdjpKkJqcDx9MYvBKrj_0",
          },
        }
      )
      .then((response) => console.log("playlist", response));
  }, []);
  return <div />;
}

export default Playlist;
